import React from 'react';

const Footer = () => {
  return(
    <div className='bg-gray-700 p-4'>
      <div className='container mx-auto text-center font-bold text-white'>
        Projeto desenvolvido por: Randel Freitas / 
        <a className='hover:underline' href='https://www.linkedin.com/in/randel-freitas-a94322b1/'> Linkedin</a>
        <div className='mt-2'>
          <img className='inline pt-4' src='/logo_semana_fsm.png'/>
          <img className='inline pt-4' src='/logo_devpleno.png'/>
        </div>
      </div>
    </div>
  )
}

export default Footer;
